class td{constructor(cellClases,textItems){this.cellClases=cellClases,this.textItems=textItems,this.iconContainers=[],this.icons=[]}iconContainer(iconContainerType,iconContainerClasses,dataAttrib,tooltipText,onClick){const iconContainer=new IconContainer(iconContainerType,iconContainerClasses,dataAttrib,tooltipText,onClick);return this.iconContainers.push(iconContainer),this.lastIconContainer=iconContainer,this}addIcon(iconClasses){return this.lastIconContainer.addIcon(iconClasses),this}textContainer(type,itemClass,text){const textItem=new Item(type,itemClass,text);return this.textItems.push(textItem),this.lastItem=textItem,this}toHtml(){return`<td class = "${this.cellClases}">\n                    ${this.iconContainers.map(ic=>ic.toHtml()).join("")} \n                    ${this.textItems.map(it=>it.toHtml()).join("")}                       \n                </td}>`}}